   	montaBarraBotao : function montaBarraBotao(tipo, param){
   		var doc = document;
   		var btnEditar = $("#btn_editar");
   		var btnVoltaLista = $("#btn_volta_lista");
   		var btnNovaPesquisa = $("#btn_nova_pesquisa");
   		var btnImprimir = $("#btn_imprimir");
   		var btnCancelar = $("#btn_cancelar");
   		var btnExcluir = $("#btn_excluir");
   		var btnExportar = $("#btn_exportar");
   		var btnPesquisar = $("#btn_pesquisar");
   		var btnNovo = $("#btn_novo");
   		var btnSalvar = $("#btn_salvar");
   		var btnVisualizar = $("#btn_visualizar");
   		var ts_id = doc.getElementById("dados_pesquisa").dataset.ts;
   		
   		btnVisualizar.hide();
   		
   		if (tipo === "pesquisa"){
   				btnVoltaLista.hide();
	   			btnSalvar.hide();
	   		   	btnNovaPesquisa.hide();
	   			btnImprimir.hide();
	   			btnEditar.hide();
	   			btnCancelar.hide();
	   			btnExcluir.hide();
	   			btnExportar.hide();
	   			btnPesquisar.show();
	   			btnNovo.show();
	   			btnNovo[0].setAttribute("onclick", "fpc.novo('"+ ts_id + "', true)");
   		}
	   	else if (tipo === "consulta"){
			btnVoltaLista.hide();
   		   	btnNovaPesquisa.hide();
   			btnPesquisar.show();
   		}else if (tipo === "lista"){
   	   			btnPesquisar.hide();
	   			btnSalvar.hide();
	   			btnVoltaLista.hide();
	   			btnImprimir.hide();
	   			btnCancelar.hide();
	   			btnExcluir.show();
	   			btnNovaPesquisa.show();
	   			btnNovo.show();
	   			btnEditar.show();
	   			btnExportar.show();
	   			btnNovo[0].setAttribute("onclick", "fpc.novo('"+ ts_id + "', false)");
   		}else if (tipo === "edicao"){
		  		btnNovaPesquisa.hide();
				btnPesquisar.hide();
				btnNovo.hide();
	   			btnImprimir.show();
	   			btnExcluir.show();
	   			btnExportar.hide();
	   			btnEditar.hide();
	   			btnVoltaLista.show();
				btnSalvar.show();
	   			btnCancelar.show();
   		}else if (tipo === "novo"){
		  		btnNovaPesquisa.hide();
				btnPesquisar.hide();
				btnNovo.hide();
	   			btnImprimir.hide();
	   			btnExcluir.hide();
	   			btnExportar.hide();
	   			// param = inclusao_direta
	   			if (param === true){
	   				btnNovaPesquisa.show();
	   			}else{
	   				btnVoltaLista.show();	
	   			}
				btnSalvar.show();
	   			btnCancelar.show();
	   			btnEditar.hide();
   		}
   		
   		var divBarraBotao = doc.getElementById("barra_botao");
   		var dat = divBarraBotao.dataset;
   		var perm = dat.perm;
   		if (perm[0] === "0"){
   			btnEditar.hide();
   			if (perm[3] === "1"){
   				if (tipo === "lista"){
   					btnVisualizar.show();
   				}
   				if (tipo === "edicao" || tipo === "novo"){
   					btnSalvar.hide();
   					btnCancelar.hide();
   				}
   			}
   		}
   		if (perm[1] === "0"){
   			btnNovo.hide();
   		}
   		if (perm[2] === "0"){
   			btnExcluir.hide();
   		}
   		dat.tipo = tipo;
   	},
   	
