$.fn.dataTable.pipeline = function ( opts ) {
    // Configuration options
    var conf = $.extend( {
        pages: 5, // number of pages to cache
        url: ''   // script url
    }, opts );
 
    // Private variables for storing the cache
    var cacheLower = -1;
    var cacheUpper = null;
    var cacheLastRequest = null;
    var cacheLastJson = null;
 
    return function ( request, drawCallback, settings ) {
        var ajax          = false;
        var requestStart  = request.start;
        var requestLength = request.length;
        var requestEnd    = requestStart + requestLength;
         
        if ( cacheLower < 0 || requestStart < cacheLower || requestEnd > cacheUpper  || fpcDataTable.forceRefresh) {
            // outside cached data - need to make a request
            ajax = true;
            fpcDataTable.forceRefresh = false;
        }
        else if ( JSON.stringify( request.order )   !== JSON.stringify( cacheLastRequest.order ) ||
                  JSON.stringify( request.columns ) !== JSON.stringify( cacheLastRequest.columns ) ||
                  JSON.stringify( request.search )  !== JSON.stringify( cacheLastRequest.search )
        ) {
            // properties changed (ordering, columns, searching)
            ajax = true;
        }
         
        // Store the request for checking next time around
        cacheLastRequest = $.extend( true, {}, request );
 
        if ( ajax ) {
            // Need data from the server
            if ( requestStart < cacheLower ) {
                requestStart = requestStart - (requestLength*(conf.pages-1));
 
                if ( requestStart < 0 ) {
                    requestStart = 0;
                }
            }
             
            cacheLower = requestStart;
            cacheUpper = requestStart + (requestLength * conf.pages);
 
            request.start = requestStart;
            request.length = requestLength*conf.pages;
 
            /* Altera o filtroIds se necessário */
    		if (fpcDataTable.idsNovos !== ""){
    			var pIdsIni = conf.url.indexOf("&filtroIds");
    			if (pIdsIni > 0){
    				var pIdsFim = conf.url.indexOf("&", pIdsIni+10);
    				if (pIdsFim == -1){
    					pIdsFim = conf.url.length;
    				}
    				var filtroIdsAntigo = conf.url.substring(pIdsIni, pIdsFim);
    				var filtroIdsNovo = "&filtroIds='"+ fpcDataTable.idsNovos + "'";
    				conf.url = conf.url.replace(filtroIdsAntigo, filtroIdsNovo);
    			}
    		}
            
            settings.jqXHR = $.ajax( {
                "url":      conf.url,
                "data":     request,
                "dataType": "json",
                "cache":    false,
                "success":  function ( json ) {
                    var js_controller = fpc.findController();
                    var hasOnFormatObject = (js_controller != undefined && js_controller.on_format_object != undefined);
                	obj_json = new Object();
                    obj_json.draw = 1;
                    obj_json.recordsTotal = 1;
                    obj_json.recordsFiltered = 1;
                    /*for (row in json){
                    	if (hasOnFormatObject){
                    		fpc.fireOnFormatObject(json[row], js_controller);
                    	}	
                    	json[row][0] = "<input class='fpc-option-grid' type='radio' name='f_id' value='"+ json[row][0] + "'/>"; 
                    }*/
                    obj_json.data = json;
                    json = obj_json;
                	
                	cacheLastJson = $.extend(true, {}, json);
 
                    if ( cacheLower != requestStart ) {
                        json.data.splice( 0, requestStart-cacheLower );
                    }
                    json.data.splice( requestLength, json.data.length );
                     
                    drawCallback( json );
                }
            } );
        }
        else {
            json = $.extend( true, {}, cacheLastJson );
            json.draw = request.draw; // Update the echo for each response
            json.data.splice( 0, requestStart-cacheLower );
            json.data.splice( requestLength, json.data.length );
 
            drawCallback(json);
        }
    }
};
 

/////////////////////  	draggable  	///////////////////////    

(function($) {
    $.fn.drags = function(opt) {

        opt = $.extend({handle:"",cursor:"move"}, opt);

        if(opt.handle === "") {
            var $el = this;
        } else {
            var $el = this.find(opt.handle);
        }

        return $el.css('cursor', opt.cursor).on("mousedown", function(e) {
            if(opt.handle === "") {
                var $drag = $(this).addClass('draggable');
            } else {
                var $drag = $(this).addClass('active-handle').parent().addClass('draggable');
            }
            var z_idx = $drag.css('z-index'),
                drg_h = $drag.outerHeight(),
                drg_w = $drag.outerWidth(),
                pos_y = $drag.offset().top + drg_h - e.pageY,
                pos_x = $drag.offset().left + drg_w - e.pageX;
            $drag.css('z-index', 1000).parents().on("mousemove", function(e) {
                $('.draggable').offset({
                    top:e.pageY + pos_y - drg_h,
                    left:e.pageX + pos_x - drg_w
                }).on("mouseup", function() {
                    $(this).removeClass('draggable').css('z-index', z_idx);
                });
            });
            e.preventDefault(); // disable selection
        }).on("mouseup", function() {
            if(opt.handle === "") {
                $(this).removeClass('draggable');
            } else {
                $(this).removeClass('active-handle').parent().removeClass('draggable');
            }
        });

    }
})(jQuery);

